<!doctype html>
<html class="staticrypt-html">
<head>
    <meta charset="utf-8">
    <link rel="shortcut icon" type="image/png" href="./images/favicon.png"/>
    <title>Resources</title>
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <meta http-equiv="cache-control" content="max-age=0"/>
    <meta http-equiv="cache-control" content="no-cache"/>
    <meta http-equiv="expires" content="0"/>
    <meta http-equiv="expires" content="Tue, 01 Jan 1980 1:00:00 GMT"/>
    <meta http-equiv="pragma" content="no-cache"/>
    <style>
        .staticrypt-hr {
            margin-top: 20px;
            margin-bottom: 20px;
            border: 0;
            border-top: 1px solid #eee;
        }
        .staticrypt-page {
            width: 360px;
            padding: 8% 0 0;
            margin: auto;
            box-sizing: border-box;
        }
        .staticrypt-form {
            position: relative;
            z-index: 1;
            background: #FFFFFF;
            max-width: 360px;
            margin: 0 auto 100px;
            padding:45px;
            text-align: center;
            box-shadow: 0 0 20px 0 rgba(0, 0, 0, 0.2), 0 5px 5px 0 rgba(0, 0, 0, 0.24);
        }
        .staticrypt-form input {
            outline: 0;
            background: #f2f2f2;
            width: 100%;
            border: 0;
            margin: 0 0 15px;
            padding: 15px;
            box-sizing: border-box;
            font-size: 14px;
        }
        .staticrypt-form .staticrypt-decrypt-button {
            text-transform: uppercase;
            outline: 0;
            background: #d42127;
            width: 100%;
            border: 0;
            padding: 15px;
            color: #ffffff;
            font-size: 14px;
            cursor: pointer;
        }
        .staticrypt-form .staticrypt-decrypt-button:hover, .staticrypt-form .staticrypt-decrypt-button:active, .staticrypt-form .staticrypt-decrypt-button:focus {
            background: #000000;
        }
        .staticrypt-html {
            height: 100%;
        }
        .staticrypt-body {
            background: #000000; /* fallback for old browsers */
            background: -webkit-linear-gradient(right, #000000, #000000);
            background: -moz-linear-gradient(right, #000000, #000000);
            background: -o-linear-gradient(right, #000000, #000000);
            background: linear-gradient(to left, #000000, #000000);
            font-family: "Arial", sans-serif;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
        }
        .staticrypt-instructions {
            margin-top: 1em;
        }
        @media only screen 
            and (min-device-width: 50px) 
            and (max-device-width: 450px) 
            and (-webkit-min-device-pixel-ratio: 1) { 
                .staticrypt-page {
                    width: 250px;
                    padding: 40% 0 0;
                }
                .staticrypt-form {
                    max-width:250px;
                    padding:25px;
                }
        }
    </style>
</head>
<body class="staticrypt-body">
<div class="staticrypt-page">
    <div class="staticrypt-form">
        <div class="staticrypt-instructions">
            <img src="./images/logo.png" alt="logo" width="40%" height="40%">
        </div>
        <hr class="staticrypt-hr">
        <form id="staticrypt-form" action="#" method="post">
            <input id="staticrypt-password"
                   type="password"
                   name="password"
                   placeholder="Enter password"
                   autofocus/>
            <input type="submit" class="staticrypt-decrypt-button" value="NEXT"/>
        </form>
    </div>
</div>
